import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>I Am a Web Designer</h1>
      <div className="header">
        <li>I Am a Web Developer</li>
        <li>About</li>
        <li>Project</li>
        <li>Education</li>
        <li>Resume</li>
        <li>Contect</li>
      </div>

      <div className="header"> 
        <img className="headerImage" src="https://cdnb.artstation.com/p/assets/images/images/012/521/703/large/alper-alkan-gadin-3.jpg?1535207487"/>
      </div>
    </div>
  );
}

export default App;
